import styled from "styled-components";
function App() {
  return (
    <Offer className="offer">
      <p>Summer Sale For All Swim Suits And Free Express Delivery - OFF 50%!</p>
      <Link>Shop Now</Link>
    </Offer>
  );
}

export default App;

const Offer = styled.div`
  background: #000;
  color: #fff;
  font-size: 14px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  padding: 6px 0;
`;

const Link = styled.a`
  color: #fff;
  font-weight: 700;
  text-decoration: underline;
  margin-left: 6ox;
`;
